import React from "react";

const Footer = () => {
  return (
    <div className="footer">
      <div className="wrapper">
        <a className="nav" href="#">
          О нас
        </a>
        <a className="nav" href="#">
          Услуги
        </a>
        <a className="nav" href="#">
          Мастера
        </a>
        <a className="nav" href="#">
          Отзывы
        </a>
        <a className="nav" href="#">
          Блог
        </a>
      </div>
    </div>
  );
};

export default Footer;
